import React from "react";
import Background from "./blogging.png"

export default function FullStackImg(props) {
  const theme = props.theme;
  var sectionStyle = {
    width: "100%",
    height: "400px",
    backgroundImage: `url(require("images/img.svg"))`
  };

  return (
    <section style={ sectionStyle }>
    </section>
  );
}
